import Header from "./components/Header";
import { BrowserRouter, Routes, Route } from "react-router-dom";

function App() {
  return (
    <BrowserRouter>
      <Routes>
        <Route path="/" exact component={<Header />} />
        <Route path="/about" component={<h1>empty</h1>} />
      </Routes>
    </BrowserRouter>
  );
}

export default App;
